import React from "react";

const RestaurantList = ({ places }) => {
  return (
    <div>
      <h2>List of Restaurants</h2>
      <ul>
        {places.map((place, index) => (
          <li key={index}>
            <div>{place.name}</div>
            <div>{place.vicinity}</div>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default RestaurantList;
